import Footer from './Components/Footer.js';
import Header from './Components/Header.js';
import Home from './Views/Home.js';
// import {
//   BrowserRouter as Router,
//   Switch,
//   Route
// } from "react-router-dom";

function App() {
  return (
    <div className="bg-gray-100 h-screen flexitems-center align-middle justify-items-center">
      <Header/>
      <div className="text-center text-gray-800 py-20 mx-5 space-y-10 max-w-screen-md">
        <Home/>
      </div>
      <Footer/>
    </div>
  );
}

export default App;
